import React, { Component } from 'react';

class LogIn extends Component {

  constructor(props, context) {
    super(props, context);
    this.state = {
      email: ''
    }
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(event) {  
    const {name, value} = event.target;
    this.setState({[name]: value});
  }

