  render() {
    return (
      <React.Fragment>
        <label>Log In</label>
        <input
          type="email"
          name="email"
          placeholder="your Email"
          value={this.state.email}
          onChange={ e => this.handleChange(e)}
        />
      </React.Fragment>
    )
  }
}

export default LogIn;
